import React from "react";
export class CountIncreasing extends React.Component{
    constructor(){
        super();
        this.state={
            counter:0
        }
this.handleCount=this.handleCount.bind(this);
    }

    handleCount(){
        console.log("clicked");

    }
    
render(){
    return(
        <>
        <h2>Counter:{this.state.counter}</h2>
        <button onClick={()=>this.setState({counter:this.state.counter+1})}>Click Here to increament count</button>
        
        </>
    )
}
}
